eurs \xE9pisodes de notre Webs\xE9rie \u201C42\xE8me \xE9tage\u201D et vous avez voulu en savoir un peu plus sur notre Soci\xE9t\xE9 ? <\/p>  <p> Nous esp\xE9rons que nous vous avons fait rire et que vous avez appr\xE9ci\xE9 cette forme d\u2019humour et d\u2019autod\xE9rision d\xE9capante. <\/p>  <p> En tous les cas, nous sommes conscients de la n\xE9cessit\xE9 de faire \xE9voluer les pratiques de notre m\xE9tier. Au sein de Sfeir, nous avons fait le choix de red\xE9finir le cadre notre m\xE9tier \u2026 et de le faire savoir ! <\/p>  <p> Vous \xEAtes les bienvenus si vous souhaitez nous rejoindre, si vous partagez le m\xEAme \xE9tat d\u2019esprit que nous, si vous avez envie de redonner toute sa valeur au m\xE9tier de consultant en France, cr\xE9ateur de valeur pour ses clients <a href='http://www.sfeir.com/webserie-42eme-etage/'>suite ...<\/a> <\/p>  <img alt='42 \xE8me Etage' src='images/42.png'>  <\/div> <\/div> <\/section>",new TN(b.b.b)).b),a.O[cFb]='GHLHE-WCDK',Rnb(Pnb),a))}
